I – do Poder Executivo federal;
II – do Supremo Tribunal Federal, do Superior
Tribunal de Justiça, do Conselho Nacional de Justiça, da
Justiça do Trabal ho, da Justiça Federal, da Justiça Militar da
União, da Justiça Eleitoral e da Justiça do Distrito Federal e dos Territórios, no âmbito do Poder Judiciário;
III – do Senado Federal, da Câmara dos Deputados e
do Tribunal de Contas da União, no âmbito do Poder Legislativo;
IV – do Ministério Público da União e do Conselho
Nacional do Ministério Público;
V – da Defensoria Pública da União.

I – receitas primárias de concessões e permissões;
II – receitas primárias de dividendos e
participações;
III – receitas primárias de exploração de recursos
naturais;
IV – receitas primárias de que trata o parágrafo
único do art. 121 do Ato das Disposições Constitucionais Transitórias;
V – receitas de programas especiais de recuperação
fiscal, destinados a promover a regularização de créditos perante a União, criados a partir da publicação desta Lei
Complementar;
VI – transferências legais e constitucionais por
repartição de receitas primárias, descontadas as decorrentes
das receitas de que tratam os incisos I a V deste parágrafo.
